job_data2 = {"success":True,"credits_left":15,"rate_limit_left":20,"job":{"linkedinIdentifier":"4060905574","title":"AI Innovator","companyName":"micorza","companyLogo":"https://media.licdn.com/dms/image/v2/D4D0BAQFG5_6uBp-OCw/company-logo_400_400/company-logo_400_400/0/1734535046335/micorza_logo?e=1747267200&v=beta&t=elrWEN70hI11ShiEW9__gn4R_LSjEUlykAZ6dxZwpjw","description":"We are looking for top AI talent to pioneer empathy in the tech product ecosystem while collaborating with an exceptional team of founders, advisors, and investors.\n\nResponsibilities\n\nLead the design and development of advanced machine learning models for text classification and clustering within a small, focused team.Collaborate closely with product management and engineering to seamlessly integrate AI functionalities into our product.Develop strategies for testing and validation of AI models to ensure high accuracy and performance.\n\nRequirements\n\nMaster's degree in Computer Science, Data Science, Artificial Intelligence, or a related field, or equivalent practical experience.2 - 4 years of experience in machine learning (ML) and natural language processing(NLP).Proven experience in leading AI projects from inception to completion.Expertise in programming languages such as Python or R.Solid understanding of text data preprocessing, feature extraction, and machine learning algorithms.Strong analytical and problem-solving skills, with an adaptable mindset.Experience with cloud platforms (AWS, Google Cloud, Azure) for deploying and managing AI solutions.\n\nThis job was posted by Ritha Sanil from Micorza.","location":"Pune, Maharashtra, India","url":"https://www.linkedin.com/jobs/view/4060905574","creationDate":"2024-10-29T04:07:04.000Z","repostedJob":False,"applicantsCount":94,"flexibility":"On-site","experienceLevel":"Mid-Senior level","contractType":"Full-time"}}